INSERT INTO `t_event` VALUES (5,'Consolidation des informations et initiatives existantes sur la restauration des mangroves &agrave; Madagascar\r\n Collecte et analyse des donn&eacute;es &eacute;cologiques et sociales permettant de comprendre l&#039;&eacute;tat actuel des zones de mangroves &agrave; restaurer et la faisabilit&eacute; de la restauration \r\n D&eacute;finition des objectifs de la restauration \r\n D&eacute;veloppement du plan op&eacute;rationnel pour la restauration de l&#039;&eacute;cosyst&egrave;me de mangroves','Elaboration du plan op&eacute;rationnel de restauration',3,'2024-02-19',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-02-23 11:26:49',1),(6,'R&eacute;daction des drafts des PAGs et conception des cartes th&eacute;matiques requises ;\r\nParticipation aux ateliers r&eacute;gional et national pour pr&eacute;sentation et soumission pour validation des drafts aupr&egrave;s des parties prenantes ; \r\nR&eacute;daction des versions finales des PAGs sur la base des commentaires re&ccedil;us lors des ateliers et soumission pour validation finale au niveau MEDD &agrave; travers de la DAPRNE.','R&eacute;daction du Plan d&#039;Am&eacute;nagement et de Gestion (PAG)',3,'2024-02-19',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-02-23 11:38:55',1),(7,'Formation des b&eacute;n&eacute;ficiaires du programme sur les th&eacute;matiques li&eacute;s &agrave; l&#039;Agriculture et le d&eacute;veloppement durable\r\nRenforcer la capacit&eacute; des b&eacute;n&eacute;ficiaires dans l&#039;inclusion productive : &eacute;conomique, technique, financi&egrave;re\r\nProposer des solutions adapt&eacute;es aux r&eacute;alit&eacute;s du terrain pour les probl&egrave;mes li&eacute;s aux changement climatiques (Activit&eacute;s d&#039;adaptation et att&eacute;nuation)\r\nFaciliter l&#039;implication des groupement axes sur le genre dans les discussions communautaire et instaurer un climat de s&eacute;curit&eacute; des participant','Appui &agrave; l&#039;encadrement des activit&eacute;s Filets Sociaux Productifs',3,'2024-02-20',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-03 16:36:53',1),(8,'Inventaire des plantations de la soci&eacute;t&eacute; SOCTAM (1 300ha) en vue d&#039;&eacute;valuer son autosuffisance en mati&egrave;re de bois et de biomasse actuel et pour d&#039;effectuer une projection en basant sur les r&eacute;sultats d&#039;inventaire et la moyenne de consommation pour les 5 ann&eacute;es &agrave; venir\r\nElaboration de la m&eacute;thodologie globale, conception des outils de collectes de donn&eacute;es, r&eacute;alisation des inventaires et d&eacute;limitation des parcelles de plantation, encadrement des &eacute;tudiants Master II pour la collecte des donn&eacute;es, traitement et analyse des donn&eacute;es, r&eacute;daction des rapports et diff&eacute;rents types de livrables','Inventaire, audit de la plantation du SOCTAM en vue d&#039;&eacute;laboration d&#039;un mod&egrave;le d&#039;am&eacute;nagement et exploitation durable de la plantation',3,'2024-02-20',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-02-23 12:48:13',1),(9,'test test test','Etude de faisabilit&eacute; d&#039;un projet de restauration des mangroves dans la r&eacute;gion Boeny (12 000ha) et &eacute;laboration d&#039;un sch&eacute;ma d&#039;Am&eacute;nagement simplifi&eacute;',3,'2024-02-23',_binary '<img style=\"background-color:transparent;border:none\" class=\" img-thumbnail w-100 photo_event\"  src=\"data:image/jpg;base64,\" />','',NULL,'2024-03-12 21:09:36',1),(10,'<ul><li>test</li><li>test</li><li>tete</li><li>test</li></ul><div></div>','Poste 1',4,'2024-03-04',_binary '<img class=\"w-100 photo_team\"  src=\"data:image/jpg;base64,\" />','',NULL,'2024-03-12 20:54:02',1),(11,'Travailler avec nous signifie b&eacute;n&eacute;ficier d&#039;une expertise exceptionnelle en conseil technique. &Agrave;vec plus de [nombre] ann&eacute;es d&#039;exp&eacute;rience, nous sommes des leaders dans notre domaine. Notre approche personnalis&eacute;e et nos solutions innovantes garantissent des r&eacute;sultats exceptionnels. Faites le choix de l&#039;excellence et de la satisfaction client en collaborant avec nous.','Poste 2',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-06 11:43:23',1),(12,'En tant qu&#039;expert en science &eacute;conomique, je poss&egrave;de une vaste exp&eacute;rience et une compr&eacute;hension approfondie des m&eacute;canismes &eacute;conomiques. Avec mes comp&eacute;tences, je peux fournir des analyses pr&eacute;cises, des conseils strat&eacute;giques et des solutions innovantes pour aider &agrave; optimiser vos d&eacute;cisions commerciales et &agrave; maximiser vos profits. Travailler avec moi vous offre l&#039;assurance d&#039;une expertise de qualit&eacute; et d&#039;un partenariat fructueux.','poste 3',4,'2024-03-04',_binary '<img style=\"background-color:transparent;border:none\" class=\" img-thumbnail w-100 photo_team\"  src=\"data:image/jpg;base64,\" />','',NULL,'2024-03-14 09:37:06',1),(13,'En tant qu&#039;expert en science de la vie, je poss&egrave;de les comp&eacute;tences et l&#039;exp&eacute;rience n&eacute;cessaires pour r&eacute;pondre &agrave; vos besoins de mani&egrave;re efficace et innovante. Avec une solide compr&eacute;hension des d&eacute;fis et des opportunit&eacute;s dans ce domaine, je suis pr&ecirc;t &agrave; collaborer avec vous pour atteindre vos objectifs et r&eacute;aliser des avanc&eacute;es significatives ensemble.','poste 4',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 10:01:30',1);
INSERT INTO `t_event` VALUES (14,'Travailler avec nous signifie acc&eacute;der &agrave; une expertise in&eacute;gal&eacute;e en fiscalit&eacute;. Avec une profonde connaissance des lois et des meilleures pratiques, nous vous offrons des solutions personnalis&eacute;es pour optimiser votre situation fiscale, maximiser vos &eacute;conomies et assurer une conformit&eacute; totale. Faites confiance &agrave; notre exp&eacute;rience et notre engagement &agrave; vous fournir des r&eacute;sultats exceptionnels.','Poste 5',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-06 11:48:52',1),(15,'En tant qu&#039;expert en transport, nous vous offrons une solution compl&egrave;te et fiable pour r&eacute;pondre &agrave; tous vos besoins logistiques. Avec notre exp&eacute;rience &eacute;prouv&eacute;e et notre engagement envers l&#039;excellence, nous garantissons des services efficaces, s&eacute;curis&eacute;s et personnalis&eacute;s. Choisissez-nous pour b&eacute;n&eacute;ficier d&#039;une collaboration transparente et d&#039;un partenariat qui optimisera votre cha&icirc;ne d&#039;approvisionnement.','poste 6',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:58:40',1),(16,'Choisir de travailler avec nous, c&#039;est choisir l&#039;expertise et l&#039;exp&eacute;rience en mati&egrave;re de juridiction. Avec plus de [X] ann&eacute;es dans le domaine, nous offrons une compr&eacute;hension approfondie des lois et des r&eacute;glementations, ainsi qu&#039;une capacit&eacute; &eacute;prouv&eacute;e &agrave; obtenir des r&eacute;sultats favorables pour nos clients. Faites confiance &agrave; notre &eacute;quipe pour vous guider &agrave; travers les complexit&eacute;s juridiques avec professionnalisme et d&eacute;vouement.','poste 7',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:58:04',1),(17,'Travailler avec nous en sociologie signifie b&eacute;n&eacute;ficier d&#039;une expertise pointue dans l&#039;analyse des structures sociales, des comportements humains et des dynamiques culturelles. Notre approche holistique et nos m&eacute;thodologies innovantes vous garantissent des insights profonds et des solutions adapt&eacute;es &agrave; vos besoins sp&eacute;cifiques, vous permettant ainsi de prendre des d&eacute;cisions &eacute;clair&eacute;es et de r&eacute;ussir vos projets avec succ&egrave;s.','Poste 8',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:57:13',1),(19,'Choisissez notre &eacute;quipe pour des solutions de s&eacute;curit&eacute; informatique fiables et innovantes. Avec une expertise pointue et une approche personnalis&eacute;e, nous assurons une protection optimale de vos donn&eacute;es et syst&egrave;mes. Ensemble, relevons les d&eacute;fis de la cybers&eacute;curit&eacute; pour garantir la tranquillit&eacute; d&#039;esprit de votre entreprise.','poste 9',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:56:33',1),(20,'Travailler avec nous dans l&#039;environnement est une opportunit&eacute; unique pour garantir des solutions durables. Avec notre expertise approfondie et notre engagement envers la pr&eacute;servation de l&#039;&eacute;cosyst&egrave;me, nous offrons des r&eacute;sultats fiables et innovants. Ensemble, nous pouvons fa&ccedil;onner un avenir meilleur, en harmonie avec la nature.','Poste 10',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:55:48',1),(21,'Travailler avec nous en communication vous offre une strat&eacute;gie cibl&eacute;e, des messages percutants et une visibilit&eacute; accrue. Notre &eacute;quipe exp&eacute;riment&eacute;e vous garantit une approche personnalis&eacute;e, des r&eacute;sultats mesurables et une collaboration transparente. Choisissez-nous pour atteindre vos objectifs de communication avec efficacit&eacute; et succ&egrave;s.','poste 11',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:55:05',1),(22,'Travailler avec nous en marketing vous offre une expertise strat&eacute;gique in&eacute;gal&eacute;e, des campagnes cr&eacute;atives percutantes et une approche personnalis&eacute;e ax&eacute;e sur vos objectifs. Notre &eacute;quipe dynamique et exp&eacute;riment&eacute;e vous accompagnera &agrave; chaque &eacute;tape pour maximiser votre visibilit&eacute;, g&eacute;n&eacute;rer des leads qualifi&eacute;s et stimuler votre croissance. Ensemble, nous r&eacute;aliserons des r&eacute;sultats exceptionnels','poste 12',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:54:18',1),(23,'Engagez nous en informatique pour b&eacute;n&eacute;ficier d&#039;une expertise pointue dans le d&eacute;veloppement de solutions logicielles innovantes. Avec des comp&eacute;tences techniques avanc&eacute;es et une approche strat&eacute;gique, notre &eacute;quipe garantit des produits de qualit&eacute;, une efficacit&eacute; op&eacute;rationnelle accrue et une exp&eacute;rience utilisateur exceptionnelle, r&eacute;pondant ainsi &agrave; vos besoins m&eacute;tier les plus complexes.','poste 13',4,'2024-03-04',_binary '<img class=\" w-100 photo_team\"  src=\"data:image/jpg;base64,\" />',NULL,NULL,'2024-03-05 09:51:16',1),(24,'<div style=\"text-align: justify;\"><ul><li>Elaboration des outils de gestion des ressources naturelles (Plan d&#039;am&eacute;nagement et de gestion, Sch&eacute;ma d&#039;Am&eacute;nagement, Zonages, ...)</li><li>Restauration des paysages et des for&ecirc;ts ;</li><li>SIG et t&eacute;l&eacute;d&eacute;tections appliqu&eacute;es &agrave; l&#039;environnement ;</li><li>Utilisation des drones dans la conservation, Agriculture de pr&eacute;cision et d&eacute;veloppement ;</li><li>Fili&egrave;re reboisement ;</li><li>Changements climatiques</li><li>Etude d&#039;impacts environnementaux.</li></ul></div>','Environnement et Foresterie',5,'2024-03-08',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />','rech',NULL,'2024-03-15 10:10:43',1),(25,'<div><div><ul><li>Enqu&ecirc;tes et &eacute;tudes socio-&eacute;conomiques aupr&egrave;s des m&eacute;nages et des communaut&eacute;s de base</li><li>Appui &agrave; la mise en place de projets communautaires</li><li>Promotion des activit&eacute;s g&eacute;n&eacute;ratrices de revenus (Identification, Mise en &oelig;uvre...)</li><li>Renforcement des capacit&eacute;s organisationnelles, socio&eacute;conomiques et institutionnelles des groupements</li><li>Sensibilisation, animation et mobilisation sociale </li><li>Elaboration de Plan de D&eacute;veloppement Communautaire</li></ul></div></div><div><br></div>','D&eacute;veloppement communautaire',5,'2024-03-08',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />','dev',NULL,'2024-03-08 12:06:45',1),(26,'<div><ul><li>Etude des fili&egrave;res</li><li>Etude de faisabilit&eacute; technico-&eacute;conomique</li><li>Montage, mise en &oelig;uvre et suivi de projets </li><li>Formation et encadrement technique </li><li>Renforcement de capacit&eacute;s</li></ul></div><div><br></div>','Management de Projets',5,'2024-03-08',_binary '<img class=\" w-100 photo_event\"  src=\"data:image/jpg;base64,\" />','rech',NULL,'2024-03-08 12:06:38',1),(27,'<div>test test test</div>','Titre 1',6,'2024-03-15',_binary '<img style=\"background-color:transparent;border:none\" class=\" img-thumbnail w-100 photo_barner\"  src=\"data:image/jpg;base64,\" />','',NULL,'2024-03-15 14:02:04',1),(28,'<div>test test test </div>','titre 2',6,'2024-03-15',_binary '<img style=\"background-color:transparent;border:none\" class=\" img-thumbnail w-100 photo_barner\"  src=\"data:image/jpg;base64,\" />','',NULL,'2024-03-15 14:05:09',1),(29,'<div>test test test </div>','test 3',6,'2024-03-15',_binary '<img style=\"background-color:transparent;border:none\" class=\" img-thumbnail w-100 photo_barner\"  src=\"data:image/jpg;base64,\" />','',NULL,'2024-03-15 14:05:30',1);
